module.exports = {"a_problem_with_svgs_and_how_to_avoid_it":{"content":"<p>I found an interesting bug while trying to nd an easy to use <span class=\"small-caps\">SVG</span> solution alternatives at work. Id like to take you on the trip I went on while trying to solve a problem, in order to get the full scope of this super niche issue.</p>\n<h2 id=\"svg-and-how-it-shouldn-t-be-implemented\"><span class=\"small-caps\">SVG</span> and how it <em>shouldnt</em> be implemented</h2>\n<p>Scalable Vector Graphics (SVGs) are an awesome bit of technology that allows you to use vector les in your <span class=\"small-caps\">HTML</span> and <span class=\"small-caps\">CSS</span>, instead of raster images. This gives you the exibility of being able to resize elements using SVGs without having to worry about them looking pixelated. However they are notoriously annoying to work with. Not <em>difcult</em> to work with, just annoying! Theres a litany of references as far as how SVGs should be implemented on front end development blogs across the web, and yet they are rarely consistent. This is mainly surprising because SVGs have been around for several years now. I remember implementing them as early as 2013, and Im sure that their actual tech spec dates back much farther than that.</p>\n<p>One of the rst widely implemented way to use SVGs was demonstrated by famed developer <a href=\"https://twitter.com/chriscoyier\">Chris Coyier</a> on <a href=\"https://css-tricks.com/using-svg/\">CSSTricks</a>. This article is still on the rst page of google results when searching for<span class=\"push-double\"></span> <span class=\"pull-double\"></span><span class=\"small-caps\">SVG</span><span class=\"push-double\"></span><span class=\"pull-double\"></span>, and understandably so. Now, Im not going to say anything bad about Chris, hes obviously a huge gure in the front end developer community. But this article has probably led to some of the worst implementations of <span class=\"small-caps\">SVG</span> that exist on the web. In this article he states that a good solution for SVGs as background images is to encode them in BASE-64 and then put them in your <span class=\"small-caps\">CSS</span>. Theres a huge problem with this though. Well several actually. The rst is that the very purpose of encoding things as BASE-64 is to save on performance. Your BASE-64 should be smaller than the original le. This can often not be the case. The second issue is that it causes your <span class=\"small-caps\">CSS</span> to look like crap. Having a big block of robotic moon-speak in the middle of your stylesheet is extremely unsettling, in contrast to the clean code Im sure everyone has written around it. The last and secretly most insidious issue, arises when you start using this technique with a preprocessor like <span class=\"small-caps\">LESS</span> or <span class=\"small-caps\">SASS</span>.</p>\n<p>Lets say you want to start using SVGs, in your nifty new preprocessor language that youve started to use, but maybe havent gotten a full grasp on how either work yet. So you stumble upon this aforementioned article, and decide to put that android-babble into a variable in your stylesheet. Maybe, because youre a bit more advanced, you want to put it in a mixin. Lets say that this is for a commonly used icon, and you proceed to reference that variable or mixin all over the place, and your code looks much cleaner than if you were to try and put a big block of garbage all over the place. And you smile at how clean your code looks, compile your stylesheet, and give yourself a pat on the back for how good of a job youve done.</p>\n<p>Except, that block of garbage cant get<span class=\"push-double\"></span> <span class=\"pull-double\"></span>referenced in your compiled <span class=\"small-caps\">CSS</span> now, it needs to be put in every place you want that <span class=\"small-caps\">SVG</span> to show up. Every single place. If you do exactly what I just mentioned, theres no shame in it. Its a totally understandable mistake, but yeah you might want to x that. If you make this mistake, your unwittingly getting rid of one of the best benets of <span class=\"small-caps\">SVG</span>: performance. Instead, youre clogging up your style request with all of this BASE-64 nonsense.</p>\n<h2 id=\"how-svgs-should-be-implemented\">How SVGs <em>should</em> be implemented</h2>\n<p>Now, this is one particular bad way to implement this, but how can we x it, and what are some other solutions? SVGs are very exible in the way of how they can be implemented, and like Ive said, there is little consistency on which way is best. In my mind, there are two ways that an <span class=\"small-caps\">SVG</span> can and should be implemented, and they both have their benet. The rst is to use them inline. SVGs can be injected directly into your markup. This allows you the added benet of being able to dynamicly manipulate them. Once an <span class=\"small-caps\">SVG</span> is inline, you can think of it as being drawn when the page is being painted by the browser, but it can be updated via <span class=\"small-caps\">CSS</span> as well. A simple example of this having an icon, that once hovered over, will change the ll color from blue to red.</p>\n<pre><code class=\"lang-HTML\">&lt;!-- in your HTML --&gt;\n    &lt;svg&gt;\n        &lt;path&gt;&lt;/path&gt; &lt;!-- part of your svg icon --&gt;\n        .\n        .\n        .\n    &lt;/svg&gt;\n</code></pre>\n<pre><code class=\"lang-SASS\">     //In your Stylesheet (sass in this example)\n    svg {\n        path {\n            fill: blue;\n        }\n\n        &amp;: hover {\n            path {\n                fill: red;\n            }\n        }\n    }\n</code></pre>\n","meta":{"creationDate":"2017-12-08T23:03:23.631Z","lastEdited":"2017-12-18T23:02:44.151Z","tags":["SVG"],"title":"A Problem with SVGs and How to Avoid It","publishDate":"2017-03-18T00:00:00-05:00"}},"bang_bang_youre_boolean":{"content":"<p>JavaScript typing is a topic of debate that is currently raging in the world of frameworks. How should things be typed in JS? Should it mimic strongly typed languages? Or should some of the weirdness of <span class=\"small-caps\">JS</span> be embraced and expanded upon with its own syntactic sugar. Well, the jury is still out on that one, but its easy to see for our little runtime-language-that-could has a future involving a much stricter rule-set. But if you dont feel like picking up something like TypeScript or <span class=\"small-caps\">ES6</span>, then theres some cool nuances that are good to have in your back pocket.</p>\n<h2 id=\"you-re-just-not-my-type\">Youre just not my type</h2>\n<p>Boolean typing in <span class=\"small-caps\">JS</span> is a bit weird. And it mainly has to do with how values are read in and subsequently evaluated. If you dont know what truthy and falsey values in <span class=\"small-caps\">JS</span> are, theyre basically values that are getting evaluated to a boolean without actually changing the value of the operand. The following values are falsey:</p>\n<ul>\n<li><code>false</code>,</li>\n<li><code>0</code> (zero),</li>\n<li><code>&#39;&#39;</code> (empty string),</li>\n<li><code>null</code>,</li>\n<li><code>undefined</code>,</li>\n<li><code>NaN</code></li>\n</ul>\n<p>And heres the values that are truthy</p>\n<ul>\n<li><em>Literally everything else</em></li>\n</ul>\n<p>Seems fairly simple right? If something is<span class=\"push-double\"></span> <span class=\"pull-double\"></span>bad or<span class=\"push-double\"></span> <span class=\"pull-double\"></span>doesnt exist, its <code>false</code>. Something that is<span class=\"push-double\"></span> <span class=\"pull-double\"></span>good or<span class=\"push-double\"></span> <span class=\"pull-double\"></span>does exist is <code>true</code>. Simple! Well, not quite. Boolean values in <span class=\"small-caps\">JS</span> have some weird nuances involving declaration statements and implementations. Heres a list of some of the annoying ones and how to deal with them.</p>\n<h2 id=\"-1-is-true-even-in-0-indexed-arrays\">-1 is true, even in 0 indexed arrays</h2>\n<p>This one is a personal pet peeve. I know that there is probably a deeply ingrained reason for this, but it doesnt make it any less annoying. As you can see from the list above of falsey values, the only numerical one is <code>0</code> (okay technically <code>NaN</code> is as well but shush). If you have some sort of equation or output that equals <code>0</code>, then it is considered <code>false</code>. This can become problematic when dealing with positioning within arrays. When you want to nd the <code>indexOf</code> an item in an array, the returned value is <code>-1</code> if the item doesnt exist in the array. Remember how I said that things that are<span class=\"push-double\"></span> <span class=\"pull-double\"></span>bad or<span class=\"push-double\"></span> <span class=\"pull-double\"></span>dont exist are falsey? Whelp, not in this case. If you try to search for the letter <code>&quot;k&quot;</code> in the word <code>&quot;fabric&quot;</code>, and try to evaluate the boolean nature of that statement, it will come out as true. But theres more. If you try to nd the position of <code>&quot;f&quot;</code> in the word <code>&quot;fabric&quot;</code>, you will get the correct position of <code>0</code>, the rst item in a zero-indexed array, and that statement evaluates as false. Again, Im sure theres a reason that the gods of programming decided to keep this the way it is, but wouldnt it be much easier if you could just just say</p>\n<pre><code class=\"lang-javascript\">if(array.indexOf(1)) {\n    //some statement based on truthiness\n} else {\n   //some statement based on falsiness\n}\n</code></pre>\n<h2 id=\"nan-does-not-equal-itself\">NaN does not equal itself</h2>\n<p>A feature of most boolean values is that they have a property of identity. If you were to compare most values to itself within a boolean operation, youd get <code>true</code>. Want to see if something evaluates to <code>true</code>? Just compare it to <code>true</code>. Trying to check if a property is <code>undefined</code>? Just write <code>property === undefined</code>. There is a notable exception to this rule, and its name is <code>NaN</code>. Not-a-Number is a special Numerical value that is somewhat rarer than other problem children like <code>undefined</code> and <code>null</code>, but that doesnt mean it isnt tricky to evaluate via <code>boolean</code>. Lets say you wanted to do and error check for a specic input that a user has given you. Lets say that by the most perfect storm of terrible inputting, they get a value of <code>NaN</code>. How do you check for that? Well surely you should be able to just write <code>inputValue === NaN</code>, right? Wrong. <code>NaN === NaN</code> evaluates to <code>false</code>. It doesnt equal itself. Now, again, I know theres a perfectly good reason as to why this is the case, and relying on <code>NaN</code> for error checking is pretty terrible programming, but nonetheless, having weirdness with fundamental values can certainly lead to some hair pulling if you arent careful.</p>\n<h2 id=\"bang-bang-you-re-a-boolean\">Bang Bang, youre a boolean</h2>\n<p>This nuance is probably my favorite, and its really just because I read the best comment about it when I was trying to gure it out. JavaScript not being strongly typed can definitely lead to comedy. Lets say you have a value, and you want to return its truthiness or falsiness. But what if youre using some sort of linting program that prevents non-strict comparisons? And what if you dont want to return <code>true</code> if the value is <code>undefined</code>, but <code>false</code> if its <code>null</code>. Well, theres a slightly obscured, amazing way to say<span class=\"push-double\"></span> <span class=\"pull-double\"></span>no, this is a true blue boolean, not some of that pseudo boolean evaluation stuff.</p>\n<pre><code class=\"lang-javascript\">!!(x)\n</code></pre>\n<p>A <code>!</code> character in boolean context basically means<span class=\"push-double\"></span> <span class=\"pull-double\"></span>take whatevers after this and make it opposite. The double-bang operator can quickly be described as <span class=\"small-caps\">NOT</span> <span class=\"small-caps\">NOT</span>. As well all know from 3rd grade english class, double negatives arent the best way to write things, but they do get the job done in this case.</p>\n<p>This expression will return true, or false depending on the value of <code>x</code>. Im going to have to give credit to Gus on stack overow for coming up with the best jingle for this. <a href=\"http://stackoverflow.com/questions/784929/what-is-the-not-not-operator-in-javascript\">http://stackoverow.com/questions/784929/what-is-the-not-not-operator-in-javascript</a>.<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Bang Bang, youre boolean. It works bests if you point nger-guns at your screen and make guns noises while running your code by the way.</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.606Z","lastEdited":"2017-12-18T23:02:44.156Z","tags":["Javascript","js","es2015"],"title":"Boolean evalulation in non-strictly typed JavaScript","publishDate":"2017-04-22T00:00:00-05:00"}},"online_education_comparison":{"content":"<p>I think that every web developer should be subscribed to some kind of online education site, so that they can regularly hone their skills and keep up to date on all the newest technologies out there. And while something can be said for learning on your own, through shotgunned google searches (since lets be honest, thats our unwritten job description), I feel having more structured tools to learning about development is essential. Even those who claim to have mastered their workow (because theyve gotten very good at nding exactly what to google) still know that their workow can change on a dime. New technologies come out every month, and while most are a ash in the pan, others stick around. With new technologies comes a lot of learning to do. There is no shame in having a helping hand as far as learning the ropes on anything new. Every developer should feel comfortable enough with feeling uncomfortable with new technology. They should be able to learn new tools quickly, and online education platforms are a great tool for doing just that. I feel that video tutorials are by far the best way to learn and keep up with new entries in the grand catalog of development tools. So with all that being said, which education platform should we use?</p>\n<p>Im going to give two answers to that question. The rst is Treehouse. The second is Lynda. These two online education sites have extensive libraries for development, are not particularly expensive, and are overall are just fantastic for learning on your own. But these two tools are vastly different from each other, and while they are both my favorites, they do not necessarily fall into the same levels of experience. So lets start with Treehouse.</p>\n<p>Treehouse is a site made specifically with web development and design in mine. Its courses are tailored towards its users wanting to learn more about how the web works, and how they can add their own pieces to this eld. Its courses are combinations of videos, quizzes, and exercises, alternating regularly within each course. This gives the user a great experience of hearing what is being said, and then immediately putting it to practice, rather than just taking notes lecture-style. Their library has a vast array of different languages, including most tools a web developer might need. Treehouse also includes a great tool called<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Tracks. These are a collection of courses that a student would need to take in order to achieve a certain goal. For example, they have a<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Front End Development Track, which goes through the basics of <span class=\"small-caps\">HTML</span> and <span class=\"small-caps\">CSS</span>, all the way to being able to create a custom WordPress theme. And while the track is obviously not exhaustive (I dont think in todays world that just a few courses can make you into a professional developer), its a way to show people who know little or nothing the right direction to move in order to become procient.</p>\n<p>In addition to this wonderful collection of courses, Treehouse has a social aspect to it. Each user gets badges and points when they complete some coursework. This seems like something small but I do have to say that I have stuck around for an extra hour once in a while just to see my points go up a little. These badges also give you a breakdown of what percentages youve applied in your learning to what languages. Your little<span class=\"push-double\"></span> <span class=\"pull-double\"></span>pizza pie of colors is a quick visual to see what languages youve learned so far. Treehouse also has a forum where you can post questions relating to coursework, which are often answered by other students or Treehouse moderators. Ive found that any question Ive had often had been asked before, and that the answer is just a click away from any video.</p>\n<p>This is not a comprehensive list of Treehouses features, but I will say that I was impressed by this education platform that I stumbled across about a year ago through a banner ad. However Treehouse does have some shortcomings. These may be things to consider before picking up a subscription.</p>\n<p>Treehouse has a very child-like design philosophy behind it. From the way that the site is designed to the courses themselves, I couldnt help feeling like a kid again, and not really in a great way. It seems like<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Nick Jr. for Web Developers at times. The way that the site is laid out with at design is one thing, but the presentation by Treehouse instructors is quite another. Ill just say it: the acting and scripts for Treehouse are pretty bad. While Im sure/ I know that the instructors know a ton about the coursework they are showcasing, the way in which they talk about it makes me feel like Im being patronized. Its not a very professional way to show web development. Even some of the examples that the user gets to build-along with instructor are child-like. While the development principle of an ecommerce solution with <span class=\"small-caps\">PHP</span> is important, do I really need to build a t-shirt site for a talking frog to prove it? It seems like a small thing, but when youve spent a lot of time watching their videos, it definitely can become annoying.</p>\n<p>Another downfall of Treehouse is that their library is lacking in some of the cutting edge areas. There have been a fair number of times that Ive looked up a certain tool, like Angular, or MongoDB, only to nd that they offer few or even no courses on the subject. Other times Ive looked up technologies, like Laravel, Ive been met with a course that is grossly out of date, being a whole iteration behind the current version. Id say that these occasions are few and far between, but definitely become more apparent when you become a more advanced developer. So if youre a beginner to a base language, its great. Otherwise, you might nd that Treehouse is not for you.</p>\n<p>This is not to say that Treehouse is bad. As I said, its one of my favorites. But I did recently pause my account, simply because I felt I learned all I could/ wanted to from their current library of courses (but it did take a very long time). But lets move on to Lynda, and see what they offer.</p>\n<p>Lynda.com is also an online education platform, but instead of being based solely on developers, they offer courses across, well, everything you could hope to learn on a computer. Its pretty much the heavy hitter when it comes to learning anything online these days. If you havent heard of it Id be surprised.  So if youre like me and have a few different hobbies based around computers, you can absolutely get a lot of mileage out of Lynda. Their presentation is concise and professional. Their list of videos in a given course are laid out conclusively so that a user can see each step they will take in learning. They also show how long each and every video is, which makes it much easier to watch if youre on a budgeted time.</p>\n<p>Ive found that that their instructors can be hit or miss. Some might just have a voice that isnt that fun to listen to for extended periods of time. For example, a lot of their JavaScript courses are taught by Ray Villalobos. And while Ray is definitely talented and has taught me a lot, a radio voice he has not.</p>\n<p>While Treehouses catalog seems to peter out once the more advanced topics are searched, Lynda seems to not have that problem. I havent had an issue yet with nding something I was looking for. Their courses dont have an aspect of interactivity to them, with exercise les to follow along only given to pro members. And while that might seem like a bad thing, it isnt all the time. Ive been able to kick back on the couch and watch some how-tos without being worried about having to follow along. Sometimes its good to just get a straight lecture. Sometimes its not. It sort of depends on how you want to learn. But the option for getting the exercise les only as a pro member is annoying. Most of the time you can follow along just ne, but it gets rid of an extra layer of structure to the content that others might like.</p>\n<p>There also isnt as much of a level of connectivity between courses. You have to know what you want to learn in order to progress. If you learn <span class=\"small-caps\">JSON</span>, then youll need to know that you should learn <span class=\"small-caps\">AJAX</span> next. Its hard to beat their catalog but sometimes its hard to gure out what you should watch next</p>\n<p>Overall, Id say Lynda is a totally solid alternative to Treehouse for developers, if you feel too advanced for Treehouses library. That is currently the place Im in right now, and its definitely working for me.</p>\n<p>To nish up, Id like to say that Im sure that there are other learning tools out there that are great, and its much more important to nd something that works for you, rather than just listening to what someone else says online. But as someone who usually has to google problems I cant solve, its nice to have a more structured format for learning and brushing up on development. To me, that is indispensable.</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.612Z","lastEdited":"2017-12-18T23:02:44.160Z","title":"Online Education Comparison","tags":["professional development","learning web development"],"publishDate":"2015-11-30T00:00:00-05:00"}},"prototype_speed_test":{"content":"<p>Prototype vs closure is an extremely interesting look at Object Oriented Javascript. Id describe myself as an intermediate level javascript developer, and have been trying to learn as much as I can with this lovely language. I quickly found myself wanting to use Object Oriented Programming as efciently as possible for my web sites. Though for small sites, the impact of using extremely <span class=\"small-caps\">DRY</span> and abstracted code is probably marginal, for larger applications its plain to see that having your code not be repetitive is a saver of time, amongst other things like bandwidth usage, memory usage, and all the other goodies that should be optimized. While brushing up on my <span class=\"small-caps\">OOP</span> and applying it to JavaScript, I ran accross the interesting difference in instantiating objects in <span class=\"small-caps\">JS</span>: Prototypes. Im sure many of the developer reading this are thinking what a noob I must be for just learning this concept, but hey, Ive never needed it before. So I wanted to learn why it was such a big deal. What was the difference between prototypes and closures in <span class=\"small-caps\">JS</span> as far as speed, memory usage, and other important factors. As it turns out, this is a very commonly asked question on StackOverow, but I wanted to see for myself what the big hubub was about. So I decided to concoct a test between these two approaches to creating objects.<span class=\"push-double\"></span> <span class=\"pull-double\"></span>A simple test on a large scale should do the trick, I thought. So I very quickly jotted down a sketch of a dice rolling script that would take a lot of dice objects, put them into an array, and see the differences between the two. First up, is creating the dice objects in both their avors.</p>\n<h2 id=\"writing-the-code\">Writing the Code</h2>\n<p>First up, a Die without prototyping.</p>\n<pre><code class=\"lang-javascript\">//without prototype\nfunction Die(sides){\n    this.sides =  sides;\n    this.roll = function(){\n        return Math.floor(Math.random() * 6) + 1;\n    }\n}\n</code></pre>\n<p>As it stands here, whenever a new instance of Die is created, the roll method will be completely recreated within object. This creates a lot of memory usage that can be avoided if prototyping was added. So next up, a Die with prototyping.</p>\n<pre><code class=\"lang-javascript\">//with prototype\nfunction ProtoDie(sides){\n    this.sides = sides;\n}\n\nProtoDie.prototype.roll = function(){\n    return Math.floor(Math.random() * 6) + 1;\n}\n</code></pre>\n<p>If youre like me and learned a different programming language before JavaScript, this might seem a bit odd. This ProtoDie is in two separate parts. Doesnt that defeat the purpose of encapsulation? The answer is, not at all. While having custom functions oating separate to your objects would absolutely be bad practice, the use of prototype here is not that. Instead, it is a single instance of the method listed, in this case<span class=\"push-single\"></span> <span class=\"pull-single\"></span>roll, across all of the different ProtoDie objects. Now you might be thinking,<span class=\"push-double\"></span> <span class=\"pull-double\"></span>whats the big deal about that? Lets keep building this simple program and nd out. The rst thing I tried testing was the speed of instantiation across multiple (and I mean multiple) objects.</p>\n<pre><code class=\"lang-javascript\">var dice = [];\n\nvar protoDice = [];\n\n\n//make 100 instances of each object\nfor(var i = 0; i &lt; 100; i++){\n    dice.push(new Die(6));\n    protoDice.push(new ProtoDie(6));\n}\n</code></pre>\n<p>Here we simply have two arrays, one for closure dice, and the other for prototype dice. After that we have a loop to make 100 objects in the array of the relative types that use that aforementioned methods. Next, I tried testing the speed of initiatig the roll method on each of these objects.</p>\n<pre><code class=\"lang-javascript\">//roll once for each instance in dice\n\nvar start = Date.now();\n\nfor(var i = 0; i &lt; 100; i++){\n    dice[i].roll;\n}\nvar end = Date.now();\n\nconsole.log(&quot;Rolling Without Prototyping: &quot; + (end - start) + &quot;ms&quot;);\n\nstart = Date.now();\n\nfor(var i = 0; i &lt; 100; i++){\n    protoDice[i].roll;\n}\nend = Date.now();\n\nconsole.log(&quot;Rolling With Prototyping: &quot; + (end - start) + &quot;ms&quot;);\n</code></pre>\n<p>Well, as it turns out, 100 objects is not enough to get an idea of the speed difference between these two. Modern computers are just too quick for a 100 objects to cause any noticeable difference between the two methods as far as instantiation speed goes. But I gured I might as well up the ante a little and try and see if/when there is a differnce in speed. as it turns out, if you change those for loops to make 100,000 instances of each object, rather than 100, you do get a difference in instantiation speed.</p>\n<pre><code>Rolling Without Prototyping: 7ms\nRolling With Prototyping: 8ms\n</code></pre><p>The fact that it took 100,000 objects for each method to see a noticeable difference means that the difference in speed between these two methods is less than negligeable as far as Im concerned. But what are some of the other differences between these two approaches to <span class=\"small-caps\">OOJS</span>.</p>\n<h2 id=\"the-good-results\">The Good Results</h2>\n<p>The other thing I wanted to test was memory usage. That seems to be the big difference. The fact that there exists only one method using the prototype approach, across all the instances of the specic object, <span class=\"small-caps\">HAS</span> to mean a huge decrease in memory. And so, I tested it. At rst, I made the mistake of testing for the size of the objects in my script.The problem with this is that these comparisons just take in to account the size of the objects construct methods, which are the same in both cases. I mistakingly used the script from the <a href=\"http://stackoverflow.com/questions/1248302/javascript-object-size\">StackOverow answer here</a>.\nSo instead, I dove into Chromes Dev tool, took a heap snapshot, and looked for the difference between these two types of objects. At last, I found the conclusive difference I had been searching for.</p>\n<pre><code>Closure:     5600 bytes\nPrototype:     1600 bytes\n</code></pre><p>That is a serious increase in memory usage between closures and prototypes. Satised with nding my answer, I decided to do a bit more research to see what others came up with. I found this <a href=\"https://github.com/podefr/benchmarks/blob/master/proto-vs-closure-memory/closure.js\">comprehensive benchmark here</a>, showing that the different in memory usage between prototypes and closures increases dramatically with more methods on the objects. Finding out this size difference was an awesome way to understand more of how prototypes work.</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.599Z","lastEdited":"2017-12-18T23:02:44.164Z","title":"A Look into The Speed of Prototypes vs. Closures","tags":["javascript","functional programming"],"publishDate":"2015-09-09T00:00:00-05:00"}},"scoping_and_handling_promise_chains":{"content":"<p>If youre a developer that uses JavaScript regularly, youve most likely come across the joy and sometimes headache of promises. Theres pretty much no way to get around using them in todays day and age. You need data from somewhere else. Thats going to take time. Promises needed. blah blah blah. Well, once youve wrapped your head around <span class=\"small-caps\">HOW</span> <span class=\"small-caps\">THEY</span> <span class=\"small-caps\">WORK</span> (which Im not really going to go into in this article), youre probably wondering what the best way to write them is. I mean, its pretty easy to get bogged down in super nested syntax, unsure of what is actually happening in what order. Libraries like Q are built to make this a lot easier. They have chaining built in, so that  you can list out in your code what order things should execute in. So if you want to call a weather api, read the results, compile some data, and then write it to your own api, you might be able to do that like this</p>\n<pre><code class=\"lang-JavaScript\">     const  Q = require(&#39;q&#39;),\n               Forecast = require(&#39;forecast&#39;); //Forecast is an npm library\n\n     //blah blah some set up stuff\n\n     //set up a promise based on a request we want to make\n     let getWeatherStuff = new Q(forecast.get(...));\n\n     getWeatherStuff\n          .then(_privates.readResults())\n          .then(_privates.compileData())\n          .then(_privates.writeToDB());\n</code></pre>\n<p>Pretty easy and straight forward right? Actually, no. This wont work. Or at least not as intended. Even though our then blocks are chained appropriately, they need to have function references, not calls, in order to work as intended. We cant guarantee the order of our calls succeeding this way. Its likely that readResults, compileData, and writeToDB will nish before our very rst call. Well thats not at all what we want. Well, how about we use references instead? That should be easy</p>\n<pre><code class=\"lang-JavaScript\">     getWeatherStuff\n          .then(_privates.readResults)\n          .then(_privates.compileData)\n          .then(_privates.writeToDB);\n</code></pre>\n<p>Cool! This will work as intended. Functions will be called in the order that they are listed in the chain. Awesome except this method has a limitation. Notice how our functions originally had no params needed? Well, the reason that these functions need to be chained together is because they will be touching the same data, presumably. Well that should work, we can just set a variable in whatever module were in, and our functions can just access it and manipulate it when needed. But what if youre running this on a node server. You dont want the same variable being set by multiple people using your server at the same time. Uh oh, things are beginning to get a bit complicated. Well thats alright, what we can do is just wrap our function calls inside of anonymous functions.</p>\n<pre><code class=\"lang-JavaScript\">     getWeatherStuff\n          .then((weatherStuff) =&gt; {\n               return _privates.readResults(weatherStuff );\n          })\n          .then((readResults) =&gt; {\n               return _privates.compileData(readResults );\n          })\n          .then(((compiledData) =&gt; {\n               _privates.writeToDB(compiledData );\n          });\n</code></pre>\n<p>So this would work, but it looks pretty ugly and cumbersome. It also doesnt cover the fact that we dont want our functions to be so reliant on each other. They can only be called in a particular order in this case, and are very reliant on their previous calls. Overall, it gets the job done, but doesnt seem like the best solution. One way to make it a bit prettier, is to use something that Ive seen called a<span class=\"push-double\"></span> <span class=\"pull-double\"></span>resultBag. What this effectively is, is a temporary data object thats meant to be the store for all data in your chain. Each function will have access to the resultBag through its params, and returns it to the next link in the chain. You could effectively write it the same as the code two iterations ago, but the logic inside your functions would have to be reliant on the result bag.</p>\n<pre><code class=\"lang-JavaScript\">     getWeatherStuff\n          .then(_privates.readResults)\n          .then(_privates.compileData)\n          .then(_privates.writeToDB);\n\n     function readResults(resultBag) {\n          //manipulates the resultBag by adding some params, and passing it along\n          return resultBag;\n     }\n</code></pre>\n<p>Do you see the problem with this? Weve seemingly decoupled our functions from being in a particular order, except not really. The resultBag is just an abstraction level that is hiding our data being set inside of it. So to reference particular data, we still need to be sure that our functions are being called in the correct order. On top of that, weve limited the amount of obvious purpose that our code should convey, by making our function parameters fairly arbitrary. I can say from experience, that this also makes debugging a pain, since you can only really see whats inside the resultBag during runtime. It also makes your code less reusable, because it expects to be dealing with a resultBag that matches what its original purpose was. Same thing for testing; youd need to mock out a full resultBag or each individual unit test. Turns out this issue isnt really as straightforward as it would seem.</p>\n<p>This is where binding becomes very useful. We are going to want to bind the context of the current request, so that we know that every request gets treated special, and wont overlap with each other. Theres a bunch of ways that this can be done. One way is instancing a class during every request, and scoping all needed information to said class. In this way, each function actually doesnt need any parameters, and can instead access variables scoped to<span class=\"push-single\"></span> <span class=\"pull-single\"></span>this;</p>\n<pre><code class=\"lang-JavaScript\">class WeatherHandler {\n     constructor() {\n          this.weatherStuff = null;\n          this.results= null;\n          this.compiledResults = null;\n     }\n\n     readResults() {\n          //manipulate this.results\n     }\n}\n\n//and then within each request, instance WeatherHandler\nrouter\n.get((req, res, next) =&gt; {\n       let weatherHandler = new WeatherHandler();\n       weatherHandler.getWeatherStuff()\n               .then(weatherHandler.readResults);\n });\n</code></pre>\n<p>This should take care of all the issues that we had beforehand. It looks much better, it behaves how we want it, it scopes our requests well, and handles our promises. Obviously this is an <span class=\"small-caps\">ES6</span> solution. And this might not be something you can implement in your project. Ive worked on large Node projects where implementing <span class=\"small-caps\">ES6</span> features (which were slightly less adopted at the time) wasnt an option. Is there a way to implement this in <span class=\"small-caps\">ES5</span>, or maybe even just without classes. well, you can scope  your functions to a local variable via the bind function. It has a similar issue as the resultbag, but it allows you to have the benet of seeing your params when your function is called, and allows you to have different parameters for all your functions.</p>\n<pre><code class=\"lang-JavaScript\">     var scope = {};\n getWeatherStuff\n          .then(_privates.initializeScope.bind(scope))\n          .then(_privates.readResults.bind(scope, scope.results))\n          .then(_privates.compileData.bind(scope, scope.dataToCompile))\n          .then(_privates.writeToDB.bind(scope, scope.dataToWriteToDB));\n</code></pre>\n<p>This should (roughly) also accomplish the same thing. Its not quite as elegant as the previous <span class=\"small-caps\">ES6</span> version, but it effectively is doing the same thing. Every call of your function can be bound to have <code>scope</code> set to <code>this</code>. It also allows your functions, like readResults, to only have a parameter for what it actually care about. The point of all of this is to show that this isnt a super straight forward thing to solve, and that promises in general are hard to deal with, even after you understand how they function.</p>\n","meta":{"creationDate":"2017-12-18T23:02:12.327Z","lastEdited":"2017-12-18T23:52:46.181Z","title":"Scoping and Handling Promise Chains","tags":["javascript","es5","es6","web development","node"],"publishDate":"2017-12-16T00:00:00-05:00"}},"setting_up_sass":{"content":"<p>Today Im going to be teaching you how to set up Sass in your web development workow. Sass is an incredibly powerful language for preprocessing websites, and I use it in pretty much every project I work on. But while Sass is fairly straightforward and easy to use, setting it up can be a bit of a pain. When I rst tried getting Sass into my work ow, I remember I had tons of questions, and wasnt really sure where to start. I hope in this video I can answer a lot of the questions you have about setting up Sass for your workow, so that by the end, youll have it ready to go for your next project.</p>\n<h2 id=\"so-what-exactly-is-sass-\">So What Exactly is Sass?</h2>\n<p>Sass is a <span class=\"small-caps\">CSS</span> Preprocessor. What that means is that you write Sass into your text editor of choice, and then run compilation on that Sass, and like a buttery turning back into a caterpillar, you will get a <span class=\"small-caps\">CSS</span> le. See while Sass is amazing, it isnt readable by any modern web browsers. So you need to output the Sass you write to <span class=\"small-caps\">CSS</span>, or else its pretty much unusable.</p>\n<p>Now when I rst started using Sass, I needed to rst set up Ruby, the language that Sass was originally written in, before getting Sass up and running. But that is not necessary any more, and having Ruby Sass is actually not ideal for our workow. If we were to use Ruby sass for our compilation task, it would take a long time. Im stating that in terms of computers. You might not notice it at rst, but once you get large les and try to compile them with Ruby Sass, it can take several seconds to complete. That might not sound like a lot, but when its happening once every few minutes, trust me, it adds up.</p>\n<p>So we are going to be using <a href=\"http://sass-lang.com/libsass\">libSass</a>, which is Sass written in C++. The main difference between normal Sass and libSass is that libSass is a lot faster. And I mean a lot. <a href=\"https://www.solitr.com/blog/2014/01/css-preprocessor-benchmark/\">Benchmarks show compilation speeds to be about 25x faster with libSass</a>. So that saves us time with installation, and time with our compilation.</p>\n<p>In order for us to use Sass seamlessly in our workow, were going to want to integrate it with a task runner of some sort. The reason for that is while I could show you how to simply compile Sass, that isnt really setting it up. You arent going to want to run a command every time you want to compile your Sass, to see the results. So instead, lets set up a task in a task runner that will compile our Sass for us, and will compile again every time we save our le.</p>\n<h2 id=\"setting-up-our-taskrunner\">Setting Up Our Taskrunner</h2>\n<p>Now if youve never used a task runner, or npm, or node, or youve never even heard of such things, well this will be a crash course in all of those. You might be asking yourself, why do I have to install all of this other garbage just to write Sass. Trust me, this is the right way to go.</p>\n<p>The rst step were going to want to do is install Node. Youre going to want to go to this link <a href=\"https://nodejs.org/en/\">here</a>, and follow the directions to install it. Now Node is basically just javascript that doesnt have to run in a web browser. Its a great tool for web developers, since web developers already know javascript for the most part. It also is the language used to run the largest package distribution network. <span class=\"small-caps\">NPM</span>.</p>\n<h2 id=\"what-s-npm\">Whats <span class=\"small-caps\">NPM</span></h2>\n<p><span class=\"small-caps\">NPM</span> stands for Node Package Manager, sort of. I remember reading somewhere that it doesnt actually stand for that, kind of like how <span class=\"small-caps\">KFC</span> is just <span class=\"small-caps\">KFC</span>, but most people will refer to it as that, or just npm. Now <span class=\"small-caps\">NPM</span> comes prebundled with Node, so you dont have to go out and get it anywhere.</p>\n<p><span class=\"small-caps\">PM</span> lets developers share projects, called packages, so that other developers can use them fop their projects. It is also what my task runner of choice, and the software we are going to use to get Sass up and running, runs on.</p>\n<p>Grunt is an awesome tool for web developers. It is the backbone of your workow. It lets you create and execute<span class=\"push-double\"></span> <span class=\"pull-double\"></span>tasks, which are basically jobs that you want done automatically, so that you dont have to think about them.</p>\n<p>We need to use <span class=\"small-caps\">NPM</span> to install grunt, along with sass. Were going to need to jump into our command line application to get this running. If youve never used a command line tool before, dont worry, it wont bite. Its something you should learn how to use eventually. and this is as good a time as any to get started.</p>\n<h2 id=\"working-in-the-command-prompt\">Working in the Command Prompt</h2>\n<p>If youre on windows, open command prompt, open terminal. For windows, all you have to do is go to your start screen or tab, and type in command prompt. click it and you should see this black box pop up.</p>\n<p>On mac, terminal can be found under applications, and then utilities. Click it to open it and you should see something similar to windows.</p>\n<p>Now were going to want to set up a folder for our project were going to use Sass on. If youre command line doesnt say that youre on the desktop, then navigate to it by typing cd, and the address of your desktop. To get this, you can go to either explorer or nder, and copy it from the address bar at the top. We can make this folder pretty much anywhere, but since its your rst time, doing it on the desktop will just let you access and see your work more easily. But feel free to make your folder elsewhere. To make your folder, type</p>\n<pre><code>mkdir {the name of the directory your want to create}\n</code></pre><p>then type</p>\n<pre><code>cd {name of the directory you created}\n</code></pre><p>This is where we are going to set up our project. To set up an <span class=\"small-caps\">NPM</span> project, type</p>\n<pre><code>npm init\n</code></pre><p>Youll get a bunch of prompts here for your project name, and a lot of other stuff. feel free to ll these out as you please, but a lot of it isnt necessary. Youd want to make this as robust as possible for a production level project, but for now, its ne.</p>\n<p>Now were going to open that folder in our text editor to see what we just did. If you drag your folder to your text editor, in this case Im using sublime text 2, youll see a le called package.json. This is where all of the information on your project is going to be, including the dependencies needed for this project. This is where we are going to declare our dependency for grunt and Sass. but we dont have to type it out here, theres an easier way to do it. Lets go back to our command line and start installing our dependencies. The rst thing were going to want to install is grunt. Its really easy to install. Type</p>\n<pre><code>npm install grunt --save-dev\n</code></pre><p>to install. All that command is doing is telling npm, to install, a package, in this case grunt, and save it as a development dependency. You can also do just save instead, but that will save it as a normal dependency, and since grunt is something we will be using in our development workow, rather than our production level deployment, its better to leave it as a devDependency.</p>\n<p>So youll see a lot of stuff come up. As long as stuff doesnt look horrible and red, it means that it worked ok. If you got some sort of error message, make sure you installed node properly in the last step.</p>\n<h2 id=\"downloading-sass\">Downloading Sass</h2>\n<p>Now were going to download Sass. Finally right? In your command prompt, type</p>\n<pre><code>npm install grunt-sass --save-dev\n</code></pre><p>Now youre probably thinking, grunt sass? I thought we were just going to be using normal sass, and then you mentioned libSass. Well grunt sass is a wrapper around libSass that well use in our grunt tasks. Were going to want to install one last dependency for our Sass compilation worow, and thats watch. Watch will let grunt automatically do our tasks when we save our les, so that we can just have it run in the background while we work. To install watch, type</p>\n<pre><code>npm install grunt-contrib-watch --save-dev\n</code></pre><p>If you go back to your text editor, and look at that package.json le, youll notice that it has those dev dependencies written out, along with the version number of the software you just downloaded. Because of this, you wont have to do the steps we just did when you want to make a new project. Instead, you can just take this package.json le, bring it to a new project, edit the information about the project, and simply type</p>\n<pre><code>npm install\n</code></pre><p>in the command prompt. in the command prompt. The stuff we just downloaded will then automatically be added to the new project. Now were going to want to congure grunt for our workow. Grunt needs to be told what to do via a javascript le called gruntle.js. Below is the le that you would use for what we want to do</p>\n<pre><code>//Gruntfile.js\n</code></pre><h2 id=\"last-steps\">Last Steps</h2>\n<p>Now we have just one last step before Sass is fully functional in our project. Back in the command line, were going to want to install the grunt command line interface, or <span class=\"small-caps\">CLI</span>, or cli, so that we can just run grunt and forget about it. to do this type</p>\n<pre><code>npm install grunt-cli -g\n</code></pre><p>The -g means it will be installed globally on your machine. If youd prefer, you can also just install it on your project, and save it with save-dev instead of -g, but if you are going to be using grunt a lot in the future, it may be benecial to have it installed globally, to save you a step in the future.</p>\n<p>And that is that. Grunt and sass are now ready to go on our projects. Simply type grunt into your command line, and your task runner will start working. Lets test it out with writing some Sass.</p>\n<h2 id=\"conclusion\">Conclusion</h2>\n<p>Alright guys I hope this was informative and gives you started with Sass in your workow. Lots of developers have similar set ups to this for writing styles for web sites. Some people prefer a different task runner called Gulp, but it is very similar to grunt.</p>\n<p>Until next time!</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.592Z","lastEdited":"2017-12-18T23:02:44.169Z","title":"How to Set Up Sass for Your Workflow","tags":["professional development","sass","web development","front end development"],"publishDate":"2015-10-18T00:00:00-05:00"}},"the_thoughts_behind_its_a_blog":{"content":"<p>Ive always loved the idea of having a blog. If youre a developer like me, you probably spend a good portion of your day reading other peoples thoughts, opinions, articles, and code snippets on blogs all over the web. The reason I got into writing code in the rst place was trying to do what someone else could do.<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Look at this guy, he made a cool navigation menu.<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Hey, this guy built out his own node server. Building things and comparing your work to that of others is something that is just going to happen in life, and especially in this industry. I love this. It makes me want to do more stuff. Often, it makes me learn that I want to do things that I had no idea about until I saw someone else do it.</p>\n<p>The same is true for a blog. If step one of learning programming is learning to write code by reading what other people wrote, probably one of the more intermediate steps is actually writing those ideas yourself. Its an appealing thought right? Having gotten through the gauntlet of learning what exactly a <span class=\"small-caps\">CSS</span> preprocessor is, or how to set up an <span class=\"small-caps\">SSL</span> cert on a new server, or whatever collection of gizmos and gadgets you currently have on your machine to build cool things, you now want to bestow onto others what you have learned, just as you had when you were in their less experienced shoes. Heres the problem though: <em>setting up a blog sucks</em>.</p>\n<p>So every person that has ever tried to start up some sort of regular writing experience, whether its a book, a blog, a series of essays, whatever, they will most likely talk about how sticking to it can be a chore some times. Writers block is something that is common parlance. So is just being lazy. The act of getting your thoughts out there is already a challenging one, and will made even more so if you have to ght your tools along the way. I live every day inside of a code editor. Im used to dealing with text. Im used to having that text do magical things for me, and have something pop out thats perfect and functional (bugs never happen, shhh). So when Ive tried to set up blogs in the past, Ive always gotten annoyed at this step:<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Great! I just set up my own site, and now I can add a blog by setting up wordpress. Crap, should this be its own subdomain? It is <span class=\"small-caps\">PHP</span> after all. Hmm but I want to show the title of this article on my home page. Inspiration to write something cool quickly turns into going through an exercise in a tech stack that youre less familiar with, or trying to think through how this should be set up.</p>\n<p>As Ive started to work more, Ive really come to adopt the strategy of getting as few things as possible in the way of me doing what I like. I want to do lots of things, quickly, and pretty well, and have them be improved later if they need to be improved. Having a B+ side project now is often better than an A project in 8 weeks. On top of that, I want to be reminded of things that I should be doing. A common tip guitarists give for learning to play guitar, is to never put your guitar in a case when youre home. Get a stand, put it in the middle of your living room. Have it staring at you as you walk by. Youll feel guilty when you dont pick it up every now and then. If I have a project called<span class=\"push-double\"></span> <span class=\"pull-double\"></span>blog staring at me within my codebase, Ill definitely notice it.</p>\n<p>All this thinking made me want to make something to make my dumb idea of writing dumb ideas easier for me. ItsABlog is built for the developers who just want to add some blog posts to their site. I dont need a database. I dont need user accounts. I dont need all the stuff that a normal <span class=\"small-caps\">CMS</span> comes with. I just need text. I just <em>want</em> text. I live in text, as Im guessing a lot of you do too. I want to write text. I want that to become a page on a website. I dont want to have to think much about it. I want it to be source controlled like everything else I do in my waking life. I want <span class=\"small-caps\">JSON</span>, I know how to deal with that. Sure, maybe theres a few cool features Id want to have here or there, tagging certain posts, showing when a post was written. If you agree with any of this, go ahead and take a look at the project on GitHub. Hopefully it can get your ideas out there a little bit easier.</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.619Z","lastEdited":"2017-12-18T23:02:44.173Z","tags":["writing","blog","javascript","itsablog"],"title":"The Thoughts Behind ItsABlog","publishDate":"2017-12-02T00:00:00-05:00"}},"what_is_good_enough_to_get_out_the_door":{"content":"<p>Youve heard the mantra.<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Give a hundred and ten percent today. Its common on football elds, or in sales meetings. But what exactly does it mean? I think some people take it to literally mean I need to do more than Ive ever done today, which is probably the most innocent take on the meaning. Others will take it to mean I want exactly 10% more than you are possibly able of doing. What exactly does 10% of effort mean? Its something that isnt empirical. I cant exactly put effort in a test tube. And not only are we just assigning value to an abstract concept, were saying that whatever that value is, it needs to be more than whats possible.</p>\n<p>I get why people say it, its to inspire people to do their best, which is often more than what they thought was their best. But inspirational idioms do not make a great product. Let me propose my system of getting things done. I shoot for 80 percent, Ill often settle for 70. Of what, you might ask. Feature value from development. I know I know, I just said that its annoying to have to hear an empirical value assigned to something intangible, but just like with the above<span class=\"push-double\"></span> <span class=\"pull-double\"></span>stick-to-itiveness-esque saying, its more of a concept than a measurement. Lets look at an example.</p>\n<p>Lets say that your product owner says that the team should build out a new contact section for a page in your web app. The initial pitch is to try and see how effective these forms are, and to increase contact rates over just having a link to an info email address. The idea is to build out a modal that will include a contact form, and that will prevent scrolling while open, should be responsive, and should include an overlay that uses a blur lter to change any content behind it. On its own, its not a super difcult feature to implement. There is probably even a library out there to do it. But in the world of professional development, especially agile, you often wont have just this one thing to worry about. Youll have a stack of stories that need to be completed before the next release, and this is just one of many. Id argue that if the purpose is to have a way to improve contact information, maybe just building out a simple contact page, or section on pages that you want people to get in touch with you from. If it can answer the question as no, its not more effective, that might answer the question enough to know not to invest more work into this project, or it could say the opposite and have you work out the heavier feature set at a later time.</p>\n<p>Its quite common however, for developers to not have a say in their project roadmap. They are told things that should be getting built, and their job is to execute. But I would argue that it is the duty of an expert to voice opinion on a feature set that he or she would be building. It might be the case that whoever is calling the shots just doesnt know possible alternatives to solutions. I guarantee that most product owners are looking for the best bang for their buck. And if their hired expert tells them,<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Why do X, when we can do Y in half the time and get nearly all the results they might just listen. Every work situation is different, but if you are in a healthy environment, alternative that save time and money should always be pitched.</p>\n<p>This line of thinking is not an excuse to cut corners. Im sure many of you know rst hand the disasterous implications of not writing unit tests, of cutting features for the sake of time, or packing them in at the expense of maintainability. The important thing is to be conscientious of the time spent getting things done, and thinking of a bigger picture. Its actually often more intensive thinking, because planning is much less of a list of todos, and instead a more meta-map of possible things to get done, each one worthy of compromise. Just understand that as a developer, your time is expensive. Software costs money to get to production, and giving users, stake holders, future code maintainers the best value per hour is invaluable in this industry.</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.637Z","lastEdited":"2017-12-18T23:02:44.179Z","title":"What is Good Enough to Get Out The Door","tags":["professional development","agile"],"publishDate":"2017-12-05T00:00:00-05:00"}},"zen_and_the_art_of_side_projects":{"content":"<p>How many of you have been here before? You just had a cool idea. You want to build this cool idea. You gured it could be something fun to work on late at night, on saturday mornings. You want to take a breath at the end and go<span class=\"push-double\"></span> <span class=\"pull-double\"></span>Ah, look at what Ive done. Heres my doo-hickie. Or maybe you just learned a new technology, and youre dying to try it out. Youre trying to nd an idea that could be good to have this new technology made with. You also want to stand at the end with some accomplishment, and say<span class=\"push-double\"></span> <span class=\"pull-double\"></span>well, heres something I did, and I learned a lot while doing this. I think these are the two main reasons for side projects: Wanting to build an idea, or wanting to learn through building.</p>\n<p>Building stuff is fun right? Youre a developer, a programmer, a web engineer. Your job is to make things. Youre a builder. And while building and solving tiny problems is fun for you, having something that you can show off is always appealing. Well, with the two scenarios above in mind, how many of your side projects have ended in incomplete garbage, things thats youve left by the wayside for months, unnished, never to be touched again. You spent 20 hours setting up a build and everything, but now youre just done with it. For one reason or another. Sucks doesnt it? Kind of feels like you did a ton of work, and yet at the end feel bad about it. Well, Ive been there too. A lot. Im pretty sure that I have a few Digital Ocean droplets out there right now that are just idly running, with half nished code on them. I have a bunch of domain names Ive bought with the intention of this<span class=\"push-double\"></span> <span class=\"pull-double\"></span>really being the time Im going to nish something. And then it doesnt happen. And then I feel like crap.</p>\n<p>Anyway, heres a list of advice that Ive learned, and Ive started completing way more projects since keeping these things in mind</p>\n<h2 id=\"1-k-i-s-s-keep-it-scoped-stupid-\">1) K.I.S.S (Keep it Scoped, Stupid)</h2>\n<p>You have big dreams, big aspirations. I get it. You want to change the world. You probably wont today. Sorry to be the bearer of bad news. In fact, you probably wont tomorrow either. This shouldnt get you down, it should be a bit of a relief. Because you dont <span class=\"small-caps\">HAVE</span> to change the world today. Think about what you could get done in a day of straight work. If youre like me, you have these bursts from time to time, where you work 20 hours developing and get something well small. Workable, cool, but smaller than what you originally hoped.</p>\n<p>You need to be conservative with your estimation sometimes, especially with side projects. They should at a bare minimum be more enjoyable than work. Ideally they should even be fun. But if your idea is going to take 100 hours, and you realize how drained you feel after a long day of work, and if you have plans this Saturday, youll start to get annoyed at yourself for not tackling your idea (which if you were to be paid to complete would cost thousands of dollars).</p>\n<p>Instead, think about a small scope. What can you get done in a short amount of time. Write out the things that you could build today, if you went on an incredible tear. And then put a full stop at the end. It might not be the biggest or shiniest idea in the world, but itll be a start. An example of this could be like this. You want to build a new social network. A Twitter clone or something. Theres 500 things you need to do before youd call it<span class=\"push-double\"></span> <span class=\"pull-double\"></span>done. Even if you did those 500 things, you might never even say it is done. But, today you could build a log in system, maybe even with a simple server. Maybe just the backend. Sweet, write down what itll take, do it, do it well, throw it in a repo, add tests to it, and some quick docs. You have completed a project. You can use that later. Sure, you might still have your big idea in mind, but for now, you have something to fall back on in case you change your mind and want to do another huge idea later.</p>\n<p>Wanting to do something else actually goes into the next piece of advice pretty well</p>\n<h2 id=\"2-the-biggest-blocker-you-re-going-to-face-is-your-own-boredom\">2) The biggest blocker youre going to face is your own boredom</h2>\n<p>You have other stuff to do. I get it. The difference between work time and free time is that you get to choose what you <span class=\"small-caps\">WANT</span> to do in your free time. If that happens to be your next big project, so be it. But as time goes on, you only get more likely to get bored of a project. Let me repeat that, youre going to get bored. You could be the most ambitious person on the planet, with an idea youre incredibly passionate about. Youre still going to get bored. And if youre not making money from that thing thats boring you, youre probably just going to stop doing it. Whats the best way to prevent this?</p>\n<p>Doing things quickly. If youre in an inspired mood to get things done, the best thing you can do is try to get as much done as possible. Try and get all that you can done while you still have the desire to do so. Im sure some of you out there are incredibly disciplined workers. Id like to consider myself one as well. But when youre cutting your own free time to do something, you might want to be conservative with your stick-to-itiveness. And I can say that Ive gotten much more projects done by dedicating a small amount of time, and going full force on it.</p>\n<h2 id=\"3-if-you-re-doing-something-for-the-first-time-it-probably-won-t-be-good\">3) If youre doing something for the rst time, it probably wont be good</h2>\n<p>The second scenario I laid out at the beginning of this article mentioned side projects that are started for the purpose of learning a new technology. It seems like an effective use of time, learning some new language, or tool, and having something useful come out of it. Unfortunately, what often ends up happening is you have some better understanding of whatever it was you were trying to learn, enough to know that what you created sucks. Its common to feel bad about this, like your project was a failure. Instead, think of it in the perspective of knowledge building, rather than project building. The main purpose of this project is to learn, not to have a usable module come out of it. This is obviously a movable scale, as its common to use new tertiary tools. But just keep in mind that part of learning something new is failing at it again and again. If you want to really create something that you would consider stable, and usable, try building it out of tools you already know. Youre much more likely to be satised by the end result, even if you feel like you havent learned too much</p>\n<h2 id=\"4-if-you-re-a-beginner-you-re-going-to-make-a-lot-of-crap\">4) If youre a beginner, youre going to make a lot of crap</h2>\n<p>This is kind of an extension of number 3. When youre rst starting out in the world of development, youre going to pretty much <span class=\"small-caps\">ONLY</span> have learning projects. You dont know enough to even begin to estimate all of the above. Thats ok. Part of being a beginner is making lots of crap, being proud of the crap for a few days, before realizing how poor it actually is. Programming has a high learning curve, and this feeling is that of hiking up it. With lots of time and practice, it does get better, but only if you stick to it. And youre much more likely to stick to it if youre positive about the progress youre making. Keep in mind how much youve been learning, different tools and libraries, stacks and build processes. It can only help in future endeavors.</p>\n<h2 id=\"5-don-t-tell-people-you-re-going-to-work-on-something\">5) Dont tell people youre going to work on something</h2>\n<p>If you are in a more social development community, online or otherwise, it might be tempting to tell people about the cool new idea you have. Or that youre in the middle of a cool project. You want to share your experiences. Dont. This isnt for any<span class=\"push-double\"></span> <span class=\"pull-double\"></span>they shouldnt know your idea because its going to change the world reason. Its more to avoid opinions being made about you. Youre likely to start way more projects than nish, and this is normal. But if you talk to people about every single one, theyre not going to care when youre talking to them for the 9th time about the<span class=\"push-double\"></span> <span class=\"pull-double\"></span>cool thing youre working on, and theyre also going to see your projects as something akin to<span class=\"push-double\"></span> <span class=\"pull-double\"></span>get rich quick schemes or<span class=\"push-double\"></span> <span class=\"pull-double\"></span>pie in the sky dreams. Things you talk about but never actually get done. Even if you get half of all the projects you talk about done, would that be something youd want to talk about regularly? This is obviously a much more nebulous rule than the others, and can vary depending on who you talk to, but its generally a good idea to just not brag, and if you are going to brag, at least brag over something that youd consider complete.</p>\n<h2 id=\"to-finish\">To nish</h2>\n<p>This ended up being a bit more ranty than I would have expected, but I think the important thing that Ive learned over the years is that the ability to nish a project is a skill, just like anything else in this industry and in life. And just like everything else, it takes time and practice to get it down well, and even then youll have slip ups. Youre going to make crap. Good! Go make crap. You <span class=\"small-caps\">CAN</span> get a cool module done in a day. It might suck, who cares? No one is giving you deadlines for your side projects. If they are, by definition it shouldnt be a side project. Just go build something today</p>\n","meta":{"creationDate":"2017-12-08T23:03:23.625Z","lastEdited":"2017-12-18T23:02:44.183Z","tags":["professional development","side project"],"title":"Zen and the Art Of Side Projects","publishDate":"2017-12-04T00:00:00-05:00"}}}

